import { PHButton } from '@src/ui/common/element/muButton';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

import './deactivate.css';

const AccountDeactivate = () => {

  return <section>
    <header>
      <h2>계정 폐쇄</h2>
    </header>
    <aside className='accountDeactivateAside'>
      <header>
        <h5>계정을 정말 폐쇄하시겠습니까?</h5>
        <p>다시 되돌릴 수 없어요!</p>
      </header>
      <PHButton variant='danger'>폐쇄하기</PHButton>
      <PHButton variant=''>취소</PHButton>
    </aside>
  </section>;
}

export { AccountDeactivate };
